title: "About us"
aboutUs: "GDG SunCoast is an inclusive community where developers, designers and entrepreneurs of all skill levels, genders and religious backgrounds are welcome to learn, practice and share Google technologies, services and platforms. We meetup in person to discuss our experiences with Google technology, participate in Google I/O Extended watch parties, DevFests and other Google related events. Our motto is \"Be excellent to each other.\" If you see or experience anything different please contact us."
